  render() {
    const repeat = (times)=> {
        const data = {
          ...times,
        }
        // console.log(times);

    }
    return (
      <div>
        <Xytimer onChangedNumber={repeat} />
        <Countdown></Countdown>
      </div>
    )
  }
}

export default XY;
